/**
 * Devuelve un array de decendientes a partir de un nodo incial cuya fecha de nacimiento es la pasada como parámetro
 *  (los datos que se pasan en el array son los pertencientes a la clase trabajdor).
 * @param {Number} annoNacimientoPrimeraPersona 
 * @returns {Array}
 */
function getFamilia(annoNacimientoPrimeraPersona){
    const annoLimite = (new Date()).getFullYear() - 22;
    let familiares = [];
    let familiaresPorInsertar = [
        {
            annoNacimiento: annoNacimientoPrimeraPersona,
            dniProgenitor: getRandomDNI(),
            primerApellido: getApellidoRandom(),
            segundoApellido: null,
            sexo: null
        }
    ]
    setTimeout(()=> familiares.segundoApellido = getApellidoRandom());
    let familiar = null;
    let datos = null;
    let dnisCreados = [];
    while(familiaresPorInsertar.length){
        let dni = getRandomDNI();
        if(dnisCreados.indexOf(dni)<0){
            datos = familiaresPorInsertar.shift();
            familiar = getRandomTrabajador(dni, datos.dniProgenitor, datos.annoNacimiento, datos.sexo === 'M'? datos.primerApellido : datos.segundoApellido, datos.sexo === 'F'? datos.primerApellido : datos.segundoApellido);
            dnisCreados.push(dni);
            if(familiar.dniProgenitor2) dnisCreados.push(familiar.dniProgenitor2);
            familiares.push(familiar);
            //Dejamos al azar cuantos hijos tendrá [0 - 4]
            let nHijos = getRandomNumberBetween(0,4);
            let otroApellido = getApellidoRandom();
            for(let x = 0; x < nHijos ;x++){
                //Los hijos los tendrá entre los 18 y los 40 años
                if(datos.annoNacimiento+18 < annoLimite){
                    let annoMax = datos.annoNacimiento+40 >= annoLimite ? annoLimite : datos.annoNacimiento+40;
                    familiaresPorInsertar.push({
                        annoNacimiento: getRandomNumberBetween(datos.annoNacimiento+18, annoMax),
                        dniProgenitor: familiar.dni,
                        primerApellido: familiar.apellido1,
                        segundoApellido: otroApellido,
                        sexo: familiar.sexo
                    })
                }
            }
        }
    }
    familiares.sort(()=> Math.random()-0.5);
    return familiares;
}

